import React from 'react';
import './Promo.css';

function Promo() {
    return (
        <section className="promo">
            <h1 className="promo__title">
                Учебный проект студента факультета Веб-разработки.
            </h1>
            <div className="promo__image"></div>
        </section>
    );
};

export default Promo;
